# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[admin].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[api].Member[serializers].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[api].Member[views].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[mixins].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[models].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[utils].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - report_builder
    - Member[views].Member[ContentType]
  - - io.StringIO~Subclass
    - report_builder
    - Member[mixins].Member[BytesIO]
  - - io.StringIO~Subclass
    - report_builder
    - Member[mixins].Member[StringIO]
